#include<bits/stdc++.h>
using namespace std;

void printVector(vector<int>&v){
    for(auto &x:v){
        cout<<x<<" ";
    }
    cout<<"\n";
}

void printVectorOfVector(vector<vector<int>>&v){
    for(int i=0;i<v.size();i++){
        for(int j=0;j<v[0].size();j++){
            cout<<v[i][j]<<" ";
        }
        cout<<"\n";
    }
    return;
}

int dp(int i,int j,vector<vector<int>>&matrix,vector<vector<int>>&memo){
    if(i<0||j<0 || j>=matrix.size())return INT_MAX;
    if(memo[i][j]!=INT_MAX)return memo[i][j];

    if(i==0){
        return memo[i][j]=matrix[i][j];
    }
    // cout<<"i:"<<i<<"j:"<<j<<endl;
    int minn=min(dp(i-1,j-1,matrix,memo),dp(i-1,j,matrix,memo));
    // cout<<minn<<endl;
    minn=min(minn,dp(i-1,j+1,matrix,memo));
    // cout<<minn<<endl;
    memo[i][j]=matrix[i][j]+minn;
    return memo[i][j];
}


int minFallingPathSum(vector<vector<int>>& matrix) {
    int n=matrix.size();
    //corner case//
    if(n==1){
        return matrix[1][1];
    }
    vector<vector<int>>memo(n,vector<int>(n,INT_MAX));
    int minn=INT_MAX;
    for(int i=0;i<n;i++){
        minn=min(minn,dp(n-1,i,matrix,memo));
    }
    printVectorOfVector(memo);
    return minn;
}

